import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-add-object',
  templateUrl: './add-object.component.html',
  styleUrls: ['./add-object.component.css']
})
export class AddObjectComponent implements OnInit {
  // to change to person stats
  name: string = '';
  description: string = '';
  price: string = '';

  constructor(
    private router: Router,
  ) { }

  ngOnInit(): void {

  }

  onSubmit(): void {
    alert('Creating new object...');
    this.router.navigateByUrl('/query');
  }
}
<div class="content-box">
    <h2>Create new object</h2>
    <form (ngSubmit)="onSubmit()">
        <div>
            <label for="name">
                Name:
            </label>
            <input id="name" name="name" type="text" (ngModel)="name" />
        </div>
        <div>
            <label for="description">
                Description:
            </label>
            <input id="description" name="description" type="text" (ngModel)="description" />
        </div>
    </form>
</div>
